import styled from "@emotion/styled";

import { Keyboard } from "./keyboard";

const list = [
  {
    name: "CK87 PBT",
    description: "특별한 컬러 디자인과 게이트론의 만남",
  },
  {
    name: "CK01 TKL PBT SL",
    description: "조용하고 특색있는 키감의 완벽한 텐키리스 키보드",
  },
  {
    name: "CX87 TKL",
    description: "H1, T1 스위치를 적용한 87키 텐키리스",
  },
  {
    name: "CY104",
    description: "키감 그리고 색감에 집중한 예쁜 키보드",
  },
];

export default function List() {
  return (
    <Container>
      <Header>
        <SvgBox>
          <Keyboard />
        </SvgBox>
        최재열 멍청이
      </Header>
      <Search placeholder="검색어를 입력해 주세요" />
      <Contents>
        {list.map(({ name, description }) => (
          <Card key={name}>
            <Name>{name}</Name>
            <Description>{description}</Description>
          </Card>
        ))}
      </Contents>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100%;
`;

const Header = styled.div`
  display: flex;
  align-items: center;
  gap: 10px;
  position: sticky;
  top: 0;
  height: 70px;
`;

const SvgBox = styled.div`
  width: 40px;
`;

const Search = styled.input`
  padding: 0 15px;
  width: 300px;
  height: 35px;
  border: none;
  outline: none;
  border-radius: 15px;
`;

const Contents = styled.div`
  flex-grow: 1;
  min-width: 280px;
`;

const Card = styled.div`
  margin: 15px 0;
  padding: 10px;
  background-color: white;
  border-radius: 10px;
`;

const Name = styled.div`
  color: #333;
`;

const Description = styled.div`
  font-size: 12px;
  color: rgb(158, 158, 158);
`;
